import React, { Component } from 'react'
import "./css/styles.css";
import "./css/w3schools.css";

export default class Intro extends Component {
  render() {
    return (
      <div class="introbackdrop">
        <img src="blue_back.JPG" alt="background blue" width="500px" height="500px"/>
        <div class="centered">
          <h2>Hi I'm Caroline!</h2>
        </div>
      </div>
    )
  }
}
